import React from "react";
import "./Card.css";

function Card({ item }) {
  return (
    <>
      <div className="box">
        <img src={item.source} alt="logo" className="image" />
        <div className="name">
          <span>{item.name}</span>
        </div>
        <div className="price">
          <span>${item.price}</span>
        </div>
        <div className="buttom">
          <button>Edit</button>
        </div>
      </div>
    </>
  );
}

export default Card;
